import React from 'react';
import './App.css';
import DetailsPokemon from './DetailsPokemon.js'
import data from './data.js'



class Pokemon extends React.Component {
    render() {
        return (
            <div>
                {data.map(pokemon=><DetailsPokemon pokemons={pokemon}/>)}
            </div>
        )
    }
}

export default Pokemon;
